import React from "react";
import { useNavigate } from "react-router-dom";

function BuyPage() {
  const navigate = useNavigate();
  const backTomain = () => {
    navigate("/");
  };

  return (
    <div>
      <h1>Buy Page</h1>
      <p> hi this is a buy page and pick a size </p>
      <button onClick={backTomain}>back</button>
    </div>
  );
}
export default BuyPage;
